1. 听到做化妆品微商朋友的回答，后来我一点也不惊奇，甚至有些情理之中。因为我不是第一次跟她沟通，她是一个做事比较务实的人，在最开始做微商的时候我还“教育”她，只管低头做好自己，少看周围那些故事，少参加那些会议，多关注产品和用户。虽然她的发展并不是那么快速，但整体比较稳，产品动销率估计可达80%，她把精力更多地放在产品和经销商管理上，尤其对代理商管理很严格。

这也正是我一直强调的，产品丶代理模式与培训决定微商走的多远多强。用她的话说，她对微商充满了信心，并且持走下去。其实我想说，微商的惨淡崩掉的是泡沫，死掉的是那些急功近利者，坚持做正确的事情，机会与成功总会属于你。','2017-04-20','邓超','0','0','uploads/20170420/7f851bd2d48fc5855821a3f13d1eee19.jpg','0','3');

我想说说最近遇见的三个事情

1）问一个做化妆品微商朋友，最近情况如何，据说这个行业很惨淡。她的回答在我预料之外，又在情理之中。她说，一切都还好，整体往上走，没有觉得很惨淡或者变化很大，也许是他们体量小。她告诉我，只是代理们越来越不愿意囤货，但是她的代理商零售和用户反馈都不错。','2017-04-20','罗胖','0','0','uploads/20170420/ac6cc64cb6cc9bba02117fa72e0ff8e8.jpg','0','2');
