insert into `product`(`id`,`img`,`title`,`desc`,`content`,`learn_num`,`tid`,`uid`,`video`,`man_desc`,`man`,`addtime`) values('2','1.jpeg','来自硅谷的产品经理修炼秘籍！听Google大牛讲述PM的成长之路','如何对转化率进行优化？亚马逊、墨迹天气、Airbnb等公司都是怎么做的？前Google产品...','上个月在准备阿里内推的时候，自己总结了下常见的产品面试问题。因为自己的知识积累很多是来源于前辈的分享，所以决定也把自己的经验分享出来。此文的面试问题，仅供大家参考。大家可以根据自己个人的情况，进行扩展。文章较长（5200字），希望能给准备产品面试的同学提供一些帮助。','0','2','0','1.mp4','中国马源的成功史','刘佳','1492422222');
insert into `product`(`id`,`img`,`title`,`desc`,`content`,`learn_num`,`tid`,`uid`,`video`,`man_desc`,`man`,`addtime`) values('17','20170420\\00fef4546275bd3cc53c7dd47365441f.jpg','决定一个企业未来营销成败的不是它掌握了多少技巧，而是它在企业移动营销战略中是否打好了从0到1的起步基础，没有基础，在华丽的营销也会坍塌。','决定一个企业未来营销成败的不是它掌握了多少技巧，而是它在企业移动营销战略中是否打好了从0到1的起步基础，没有基础，在华丽的营销也会坍塌。','决定一个企业未来营销成败的不是它掌握了多少技巧，而是它在企业移动营销战略中是否打好了从0到1的起步基础，没有基础，在华丽的营销也会坍塌。','0','1','0','20170420/a190e23dd03283fc6bffc57e79bdcf9b.mp4','独立咨询师，专业理财师，微软Office认证专家，氧气职场专栏作者。 曾接受系统的速读训练，大学期间读书逾500本。对于快速阅读、高效读书和如何拆书有自己的独到见解和思考','化之之','1492679856');
insert into `product`(`id`,`img`,`title`,`desc`,`content`,`learn_num`,`tid`,`uid`,`video`,`man_desc`,`man`,`addtime`) values('1','2.jpeg','如何做好时间管理如何成为一个高度自律的人？','营销，就是一场对人性的洞察，人性在生活中才会表现淋漓尽致，所以营销，源自于生活，它无处不在。而我的很多对于营销的观察，研究思考，源于聊天丶对话，生活现象。','1、时间管理能力是有个人管理属性，学习一项技能。 2、三大法则：目标性法则。要事优先法则。组织计划法则。 3、管理学理论：一万个小时理论 4、要事优先法则：把重要的事情放在前面+一次只做好一件事情。 5、时间管理四大法则：1、目标分解法。2、单点突破法：计划、实施、总结、评估。 3、核心竞争力法：早晨的时间发展自己的事业。 4、自我激励法:a实现延迟法。 6、不要模仿大咖的做法。 7、如何处理手机的关系。b、考虑远虑和近忧。c、做好长线安排。d、文案标准法 e、睡好觉。','0','3','0','20170417/26fac9597c32e193c262615ff3d4b8a2.mp4','全国青年领导力（GYL）公益品牌创始人兼CEO ；智能共享空间——极北咖啡创始人兼CEO；创立了职场人最实用的干货分享平台—下班加油站的创始人兼总架构设计师。
insert into `product`(`id`,`img`,`title`,`desc`,`content`,`learn_num`,`tid`,`uid`,`video`,`man_desc`,`man`,`addtime`) values('18','20170420\\c974c84a796081e63458890f09b74f00.jpg','产品经理面试：哪些问题是你没有准备的？','仅有700粉丝，却打造了200万+阅读爆款文章，他有哪3个秘籍？','：作为一个以图片社交为核心的平台，网易lofter通过设计不同类型的互动模式，同时，不断地对...','0','4','0','20170420/462125964534cf951b6cc5f5a0aee80f.mp4',' 2016年初创办定位娱乐影音的自媒体品台「小字」，其中“年少不听李宗盛，听懂已过不惑年”在粉丝仅有700的情况下最终创造200万点击的现象级爆文。','王夜璃','1492679997');
